import React from 'react'
import styled from 'styled-components'

const Container = styled.div`
  background : black;
  width : 100%;
  height : 70px;
`
const Wrapper = styled.div`
  display :flex;
  background-color: white;
  width: 100%
`

export default function Navbar() {
  return (
    <Container>
      Shop here boy
    </Container>
  )
}
